import React from "react";

const Header = () => {
  return (
    <nav className="navbar navbar-dark bg-dark">
      <div className="container-fluid">
        <h1 className="navbar-brand">Agenda React + Reducer + API</h1>
      </div>
    </nav>
  );
};

export default Header;
